import {useEffect} from "react";

export const request_api = async (url, options)=>{
    useEffect(()=>{
        console.log(1);
    },[]);
    const doFetch=async()=>{
        const response = await fetch(url, options);
        const json = await response.json();
    }
    
    return json;
};
